import React from "react";
import ReactDOM from "react-dom";

import "./styles.css";

import useFormValidation from "./useFormValidation";
import validateAuth from "./validateAuth";

const INITIAL_STATE = {
  email: "",
  password: ""
};

function Index() {
	
	return (
		<div>
			<div>
				<Login />
				<Register />
			</div>
			<div>
				<IngredientSearch />
				<RecipeSearch />
				<AddRecipe />
			</div>	
			<div>
				<APIreturn />
			</div>
		</div>
	);
}

function APIreturn() {
	return (
		<div className="container">
			<h1>API Return</h1>
			<textarea
				id="apireturn"
				name="apireturn"
				row="4"
				cols="50"
			/>
		</div>
	);
}

function AddRecipe() {
	
	return (
		<div className="container">
			<h1>Add Recipe</h1>
			<form onSubmit={console.log("you pushed add!")}>
				<input
					name="newrecipename"
					autoComplete="off"
					placeholder="Recipe Name"
				/>
				<div>
				<button disabled={isSubmitting} type="submit">
					Submit
				</button>
				</div>
			</form>
		</div>
	);
}

function IngredientSearch() {
	
	return (
		<div className="container">
			<h1>Ingredient Search</h1>
			<form onSubmit={console.log("you pushed search 2!")}>
				<input
					name="ingredientname"
					autoComplete="off"
					placeholder="Search Term"
				/>
				<div>
				<button disabled={isSubmitting} type="submit">
					Submit
				</button>
				</div>
			</form>
		</div>
	);
}

function RecipeSearch() {
	
	return (
		<div className="container">
			<h1>Recipe Search</h1>
			<form onSubmit={console.log("you pushed search!")}>
				<input
					name="recipename"
					autoComplete="off"
					placeholder="Search Term"
				/>
				<div>
				<button disabled={isSubmitting} type="submit">
					Submit
				</button>
				</div>
			</form>
		</div>
	);
}

function Login() {

  return (
    <div className="container">
      <h1>Login Test</h1>
      <form onSubmit={console.log("you pushed login!")}>
        <input
          name="loginemail"
          className={errors.email && "error-input"}
          autoComplete="off"
          placeholder="Your email address"
        />
        <input
          name="loginpassword"
          type="password"
          placeholder="Choose a safe password"
        />
        <div>
          <button disabled={isSubmitting} type="submit">
            Submit
          </button>
        </div>
      </form>
    </div>
  );
}

function Register() {

  return (
    <div className="container">
      <h1>Register Test</h1>
      <form onSubmit={console.log("you pushed register!")}>
        <input
          name="registeremail"
          autoComplete="off"
          placeholder="Your email address"
        />
        <input
          name="registerpassword"
          type="password"
          placeholder="Choose a safe password"
        />
        <div>
          <button disabled={isSubmitting} type="submit">
            Submit
          </button>
        </div>
      </form>
    </div>
  );
}

const rootElement = document.getElementById("root");
ReactDOM.render(<Index />, rootElement);
